import React from "react";
import "./EmptyTodos.css";

function EmptyTodos() {
  return (
    <section className="empty-todos-section">
      <img src="../assets/img/Charco - Pet.png"/>
      <p className="text">Let's create a to do!</p>
    </section>
  )
  ;
}

export { EmptyTodos };
